import React from "react";
import { faTools } from '@fortawesome/free-solid-svg-icons'

import Card from "../common/card";

import "./styles/skills.css";

const skills = () => {
	return (
		<div className="skills">
			<Card
				icon={faTools}
				title="Back End"
				body={
					<div className="skills-body">
						<div className="skill">
							<img
								src="./facebook.png"
								alt="facebook"
								className="skill-image"
							/>
							<div className="skill-title">Airbus D&S</div>

						</div>

						<div className="skill">
							<img
								src="./twitter.png"
								alt="twitter"
								className="skill-image"
							/>
							<div className="skill-title">Twitter</div>
						</div>
					</div>
				}
			/>
		</div>
	);
};

export default skills;
